[FakeTaxi] Christine (1112 / 03.31.2014)

My next fare was a woman looking to catch a train but I said i would do the same same journey for a very good price and she said ok and we were on our way. I asked her if she would like a discount on the taxi if we done some role playing with a camera, she was interested so I pulled over to see how far I could go.

